import React, { Component } from 'react';

class Serachbar extends Component {
  state={
    searchQuery: " "
  }
  render() {
    return <div className='form-row mb-5'>
      <div className='col-12'>
        <br>
        </br>
      <input onChange={(event)=> this.setState({searchQuery: event.target.value})} type="text"  className='input-group' placeholder='Search movie'></input>
      </div>  
    </div>;
  }
}
export default Serachbar;
